#!/bin/sh
# Name: Uninstall Alpine
# Author: GC777
# Icon: data:image/jpeg;base64,

ALPINE_BASE_FOLDER="/mnt/us"
ALPINE_INSTALL_URL="https://github.com/GreenCat-777/quicklinux-misc-files/releases/download/qai/install_alpine.sh"

rm $ALPINE_BASE_FOLDER/alpine.ext3
rm $ALPINE_BASE_FOLDER/alpine.sh
rm $ALPINE_BASE_FOLDER/alpine.log
rm $ALPINE_BASE_FOLDER/alpine.conf
rm $ALPINE_BASE_FOLDER/alpine.zip
mntroot rw
rm /etc/upstart/alpine.conf
mntroot ro
rm $ALPINE_BASE_FOLDER/documents/alpinesc.sh
cd $ALPINE_BASE_FOLDER/documents/
curl -L -o "install_alpine.sh" "$ALPINE_INSTALL_URL"
rm $ALPINE_BASE_FOLDER/documents/uninstall_alpine.sh